NON_FEATURE_COLS = {
    "label", "source_dataset", "smiles", "SMILES", "inchikey", "InChIKey",
    "inchi", "InChI", "id", "ID", "molid", "MOLID", "name", "Name"
}

def detect_feature_columns(df: pd.DataFrame) -> List[str]:
    """FINGERPRINT_COLUMNS doluysa doğrula ve kullan; değilse sayısal otomatik."""
    if FINGERPRINT_COLUMNS:
        missing = [c for c in FINGERPRINT_COLUMNS if c not in df.columns]
        if missing:
            raise ValueError(f"Belirtilen fingerprint sütunları eksik: {missing[:10]} ...")
        return list(FINGERPRINT_COLUMNS)
    # otomatik tespit
    num_cols = df.select_dtypes(include=[np.number]).columns.tolist()
    feats = [c for c in num_cols if c not in NON_FEATURE_COLS]
    if not feats:
        raise ValueError("Özellik (fingerprint) sütunu bulunamadı.")
    return feats

def coerce_numeric(df: pd.DataFrame, cols: Iterable[str]) -> pd.DataFrame:
    out = df.copy()
    for c in cols:
        out[c] = pd.to_numeric(out[c], errors="coerce")
    return out

def build_model():
    return Pipeline([
        ("imputer", SimpleImputer(strategy="median")),
        ("clf", ExtraTreesClassifier(
            n_estimators=600,
            random_state=RANDOM_STATE,
            n_jobs=-1
        ))
    ])

def proba(est, X):
    if hasattr(est, "predict_proba"):
        return est.predict_proba(X)
    raise ValueError("Model predict_proba desteklemiyor.")

